import { createRouter, createWebHistory } from 'vue-router';
import Inicio from '@/views/Inicio.vue'; // Cambia 'Inicio.vue' si el nombre es otro
import Productos from '@/views/Productos.vue';
import Contacto from '@/views/Contacto.vue';

const routes = [
  {
    path: '/',
    name: 'Inicio',
    component: Inicio, // Asegúrate de que esto sea el componente correcto
  },
  {
    path: '/productos',
    name: 'Productos',
    component: Productos,
  },
  {
    path: '/contacto',
    name: 'Contacto',
    component: Contacto,
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
